import './App.css';
import Home from './components/Home';
import NewRegistration from './components/NewRegistration';
import Users from './components/Users';
function App() {
  return (
    <>
      <h1>Hello Interview Projects</h1>
      <Home/>
      <Users/>
      <NewRegistration/>
    </>
  );
}

export default App;
